import React from "react";
import Item from "./Components/item";
const msg = [
  {
    id: 1,
    attributes: {
      name: "孙悟空",
      gender: "男",
      age: 18,
      address: "花果山",
    },
  },
  {
    id: 2,
    attributes: {
      name: "猪八戒",
      gender: "男",
      age: 28,
      address: "高老庄",
    },
  },
  {
    id: 3,
    attributes: {
      name: "沙和尚",
      gender: "男",
      age: 38,
      address: "流沙河",
    },
  },
];
const App = () => {
  const [data, setData] = useState(msg);
  return (
    <div>
      <ul>
        {data.map((item) => (
          <Item stu={item.attributes} />
        ))}
      </ul>
    </div>
  );
};

export default App;
